import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { handleSignUp } from '../handles'; // Ensure this path is correct based on your project structure
import './App.css';

function Admin() {
    const [transactions, setTransactions] = useState([]);

    useEffect(() => {
        const fetchTransactions = async () => {
            // Assuming no specific query is needed for fetching all transactions
            try {
                const data = await handleUpdateTransactions({});
                setTransactions(data);
            } catch (error) {
                console.error('Error getting transactions', error);
            }
        };

        fetchTransactions();
    }, []);

    return (
        <div className="AppContainer">
            <h1 className='Text'>Transactions</h1>
            {transactions.map((transaction, index) => (
                <div className="List" key={index}>
                    <div>User ID: {transaction.user_id?._id}</div>
                    <div>User Name: {transaction.user_id?.name}</div>
                    <div>File ID: {transaction.file_id?._id}</div>
                    <div>File Name: {transaction.file_id?.name}</div>
                    <div>Timestamp: {new Date(transaction.timeStamp).toLocaleString()}</div>
                    <div>Uploaded: {transaction.up ? "Yes" : "No"}</div>
                </div>
            ))}
        </div>
    );
}

export default Admin;
